import React, { Component, Fragment } from "react";
import { Link } from "react-router-dom";
import { Navbar, Nav } from "react-bootstrap";
import "../styles/header.css";

const right = {
  textAlign: "right",
};

export class Header extends Component {
  render() {
    return (
      <header class="header">
        <div>
          <a class="icon" href="/code" target="_blank">
            Code
          </a>
          <a class="icon" href="/videos" target="_blank">
            Videos
          </a>
          <a class="icon" href="/photos" target="_blank">
            Photos
          </a>
        </div>
      </header>
    );
  }
}

export default Header;
